import React, { Component } from 'react';
import './App.css';
// import Park from './Park';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="wrapper">
         <Parks name="Yosemite" url="http://upload.wikimedia.org/wikipedia/commons/thumb/c/c7/YosemitePark2_amk.jpg/200px-YosemitePark2_amk.jpg"/>
        <Parks name="Acadia" url="http://upload.wikimedia.org/wikipedia/commons/thumb/b/b1/Bass_harbor_head_light_20041002_123635_1.1504x1000.jpg/200px-Bass_harbor_head_light_20041002_123635_1.1504x1000.jpg"/>

        </div>
      </div>
    );
  }
}

function Parks(props){
  return (
    <div className="parkBoard">
      <div className="parkAvantar">
        <img src={props.url} className="avantar" alt="logo"/>
      </div>
      <div className="parkInfo">
        <h4>{props.name}</h4>
      </div>
    </div>
  );
}

export default App;
